package Operators;
import java.util.Scanner;
public class First {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner s=new Scanner(System.in);
		int n=s.nextInt();
		int m=s.nextInt();
		System.out.println(m+n);
		System.out.println(m-n);
		System.out.println(m*n);
		System.out.println(m/n);
		System.out.println(m%n);
		
		

	}

}
